import { Component } from "react";

export class Counter extends Component {
  render() {
    return (
      <div>
        <span>0</span>

        <div>
          <button>Увеличить на 1</button>
          <button>Уменьшить на 1</button>
        </div>
      </div>
    );
  }
}
